import React from "react";
import "./Profile.css";

const Profile = () => {
  return (
    <div className="container">
      <h1>내 프로필</h1>
      <p>내 MBTI</p>
      <p>MBTI 사진 (아이콘)</p>
      <p>내가 쓴 글</p>
      <p>내가 댓글 단 글</p>
    </div>
  );
};

export default Profile;
